select count(*) as aggregate from (select `bravo_boats`.* from `bravo_boats` where `bravo_boats`.`status` = 'publish' and ( '6371' * acos(
cos( radians('41.0370023') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('28.9850917') )
+ sin( radians('41.0370023') ) * sin( radians(map_lat) )
)
) <= '7' and `bravo_boats`.`deleted_at` is null group by `bravo_boats`.`id`) as `aggregate_table`

select `bravo_boats`.* from `bravo_boats` where `bravo_boats`.`status` = 'publish' and ( '6371' * acos(
cos( radians('41.0370023') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('28.9850917') )
+ sin( radians('41.0370023') ) * sin( radians(map_lat) )
)
) <= '7' and `bravo_boats`.`deleted_at` is null group by `bravo_boats`.`id` order by POW((bravo_boats.map_lng-28.9850917),2) + POW((bravo_boats.map_lat-41.0370023),2), `is_featured` desc, `id` desc limit 15 offset 0
